/*
Author: Ted Jenks

React-Native component to serve as a portal for the entry of personal details
on signing up to the service.
 */

//------------------------------------------------------------------------------

/* IMPORTS */

// React imports
import React, {Component} from 'react';
import {Alert, TextInput, View} from 'react-native';

// Local imports
import styles from '../../../style/styles';
import {IdentityManager} from '../../../tools/identityManager';
import CustomButton from '../../generic/customButton';
import Section from '../../generic/section';
import NavButton from '../../generic/navButton';

// Third party packages
import {launchCamera} from 'react-native-image-picker';
import * as Keychain from 'react-native-keychain';
const fetch = require('node-fetch');
const formData = require('form-data');
const Web3 = require('web3');
import {Colors} from 'react-native/Libraries/NewAppScreen';

// Global constants
import {BLOCKCHAIN_URL, SIGN_UP_URL} from '@env';
const web3 = new Web3(BLOCKCHAIN_URL);

//------------------------------------------------------------------------------

/* BODY */

class EnterDetails extends Component {
  state = {
    data: {
      personal: ['', '', ''],
      nationality: ['', ''],
      address: ['', '', '', ''],
      document: [''],
    }, // data entered by user
    documentImageData: null,
    photoData: null,
    pageCount: 0,
    address: null,
  };

  constructor() {
    super();
  }

  incompleteAlert = () =>
    // show alert informing user that the form is not complete
    Alert.alert(
      'FORM NOT COMPLETE',
      'Please enter all necessary information to continue',
      [{text: 'OK', onPress: () => console.log('OK Pressed')}],
    );

  checkComplete = () => {
    // check that the form has been completed
    for (const datum in this.state.data) {
      for (const item of datum) {
        if (item == '') {
          return false;
        }
      }
    }
    if (this.state.photoData == null || this.state.documentImageData == null) {
      return false;
    }
    return true;
  };

  sendDataToServer = () => {
    // address of server for sign-up
    const url = SIGN_UP_URL;
    const headers = {
      Accept: 'application/json',
    };
    // create formData object to send via https
    const form = new formData();
    form.append('Content-Type', 'application/octet-stream');
    form.append('name', this.state.data.personal[0]);
    form.append('dob', this.state.data.personal[1]);
    form.append('pob', this.state.data.nationality[1]);
    form.append('expiry', this.state.data.document[0]);
    form.append('house', this.state.data.address[0]);
    form.append('street', this.state.data.address[1]);
    form.append('city', this.state.data.address[2]);
    form.append('postcode', this.state.data.address[3]);
    form.append('sex', this.state.data.personal[2]);
    form.append('nationality', this.state.data.nationality[0]);
    form.append('bc_address', this.state.address);
    form.append('image', this.state.photoData, 'base64');
    form.append('doc', this.state.documentImageData, 'base64');
    // make https put request
    fetch(url, {method: 'POST', headers: headers, body: form})
      .then(data => {
        console.log(data);
      })
      .catch(err => {
        console.log(err);
      });
  };

  tedImageOne = () => {
    // dev tool for quickly filling in form during development
    this.setState({
      photoData:
        '',
    });
  };

  tedImageTwo = () => {
    // dev tool for quickly filling in form during development
    this.setState({
      photoData:
        '',
    });
  };

  createAccount = async () => {
    // generate account and key on BC
    const modelAccount = web3.eth.accounts.create();
    const accounts = await web3.eth.personal.getAccounts();
    const address = await web3.eth.personal.importRawKey(
      modelAccount.privateKey,
      modelAccount.privateKey,
    );
    const account = {address: address, privateKey: modelAccount.privateKey};
    return account;
  };

  saveAccountToKeychain = async account => {
    // save BC account information in keystore
    await Keychain.setGenericPassword(account.address, account.privateKey);
  };

  writeDataToRealm = () => {
    const account = this.createAccount() // generate account
      .then(account => {
        console.log('Account generated: ', account);
        this.saveAccountToKeychain(account).catch(e => console.log(e)); // save account locally
        this.setState({address: account.address});
        const identityManager = new IdentityManager(); // open instance of realm to save to
        console.log('writing...');
        identityManager
          .storeID(
            // save data to realm
            this.state.data.personal[0],
            this.state.data.personal[1],
            this.state.data.nationality[1],
            this.state.data.document[0],
            this.state.data.address[0],
            this.state.data.address[1],
            this.state.data.address[2],
            this.state.data.address[3],
            this.state.data.personal[2],
            this.state.data.nationality[0],
            this.state.photoData,
            account.address,
          )
          .then(r => {
            // update the display
            this.props.onSubmit();
            // send data to sign up server
            this.sendDataToServer();
          })
          .catch(e => console.log(e));
      });
  };

  handleNextPage = () => {
    let currentPage = this.state.pageCount;
    currentPage++;
    this.setState({pageCount: currentPage});
  };

  handlePrevPage = () => {
    let currentPage = this.state.pageCount;
    currentPage--;
    this.setState({pageCount: currentPage});
  };

  handleAutofill = () => {
    // dev tool for quickly filling in form during development
    this.setState({
      data: {
        personal: ['Mr Someone LOL', '2000-06-01', 'Male'],
        nationality: ['United Kingdom', 'London'],
        address: ['22a', 'Greswell Street', 'London', 'SW6 6PP'],
        document: ['2028-01-01'],
      },
      pageCount: 4,
      documentImageData:
        '',
    });
  };

  handleSubmit = () => {
    if (this.checkComplete()) {
      // write data to file and then submit
      this.writeDataToRealm();
    } else {
      console.log('Form not complete');
      this.incompleteAlert();
    }
  };

  handleLaunchCameraDirection = direction => {
    // launch camera and save the photo
    let options = {
      mediaType: 'photo',
      includeBase64: true,
      cameraType: direction,
      maxHeight: 500,
      maxWidth: 500,
    };
    launchCamera(options, response => {
      // console.log('Response = ', response);
      if (response.didCancel) {
        console.log('User cancelled image picker');
      } else if (response.error) {
        console.log('ImagePicker Error: ', response.error);
      } else {
        // successful image collection
        this.setState({
          documentImageData: response.assets[0].base64,
        });
      }
    }).catch(e => console.log('Unhandled camera exception: ', e));
  };

  formFromFields = (fields, dataKey) => {
    return (
      <View>
        {this.state.data[dataKey].map((value, key) => (
          <TextInput
            style={styles.input}
            key={key}
            label={fields[key]}
            mode="outlined"
            placeholder={fields[key]}
            placeholderTextColor={Colors.dark}
            value={value}
            onChangeText={res => {
              let newData = this.state.data;
              newData[dataKey][key] = res;
              this.setState({data: newData});
            }}
            ref={input => {
              this.name = input;
            }}
          />
        ))}
      </View>
    );
  };

  dataEntryForm = (
    fields,
    title,
    description,
    first = false,
    final = false,
    imageElement = null,
  ) => {
    return (
      <View style={{flex: 1}}>
        <View>
          <Section title={title}>{description}</Section>
          {!final && this.formFromFields(fields, title.toLowerCase())}
          {imageElement}
        </View>
        <View style={styles.buttonContainer}>
          {!first && <NavButton text={'Back'} onPress={this.handlePrevPage} />}
          {first && (
            <NavButton text={'Autofill'} onPress={this.handleAutofill} />
          )}
          {!final && <NavButton text={'Next'} onPress={this.handleNextPage} />}
          {final && <NavButton text={'Submit'} onPress={this.handleSubmit} />}
        </View>
      </View>
    );
  };

  personalDataEntry = () => {
    return this.dataEntryForm(
      ['Name', 'Date of Birth (YYYY-MM-DD)', 'Sex'],
      'Personal',
      'Please enter your personal information as it appears on your' +
        ' document below.',
      true,
    );
  };

  nationalityDataEntry = () => {
    return this.dataEntryForm(
      ['Nationality', 'Place of Birth'],
      'Nationality',
      'Please enter your nationality information as it appears on your' +
        ' document below',
    );
  };

  addressDataEntry = () => {
    return this.dataEntryForm(
      ['House', 'Street', 'City', 'Postcode'],
      'Address',
      'Please enter your address as it appears on your document below.',
    );
  };

  documentDataEntry = () => {
    return this.dataEntryForm(
      ['Expiry (YYYY-MM-DD)'],
      'Document',
      'Please enter your document expiry dat and upload a photo of your' +
        ' document.',
      false,
      false,
      <View style={{padding: 10}}>
        <CustomButton
          text={'Take Photo'}
          onPress={() => this.handleLaunchCameraDirection('back')}
        />
      </View>,
    );
  };

  imageDataEntry = () => {
    return this.dataEntryForm(
      [],
      'Image',
      'Please take a photo of your face. You must not wear glasses or ' +
        'obstruct your face in any way. Makeup must not be worn and hair must ' +
        'be tied back. The photo should be taken around 50cm away at eye ' +
        'level with your face in the center if the image. Do not smile or ' +
        'make any other expressions. ' +
        '\n\n' +
        'Failure to comply with these restrictions will result in your ' +
        'account being rejected.',
      false,
      true,
      <View style={{padding: 10}}>
        <CustomButton
          text={'Take Photo'}
          onPress={() => this.handleLaunchCameraDirection('front')}
        />

        <CustomButton text={'Use Ted Image One'} onPress={this.tedImageOne} />
        <CustomButton text={'Use Ted Image Two'} onPress={this.tedImageTwo} />
      </View>,
    );
  };

  render() {
    const pages = [
      this.personalDataEntry,
      this.nationalityDataEntry,
      this.addressDataEntry,
      this.documentDataEntry,
      this.imageDataEntry,
    ];
    return (
      <View
        style={{
          height: '100%',
        }}>
        <CustomButton text={'Cancel'} onPress={this.props.onBack} />
        {pages[this.state.pageCount]()}
      </View>
    );
  }
}

//------------------------------------------------------------------------------

/* EXPORTS */

export default EnterDetails;
